def isprime(num):
    count = num / 2
    while count >1:
        if num % count == 0:
            return False
            break
        else:
            count -= 1
    else:
        return True

def getfactor(num):
    l = []
    if isprime(num):
        return [num]
    count = num / 2
    for n in range(2, count + 1):
        if num % n == 0 and isprime(n):
            l.append(n)
    return l

def suyinzi(num):
    fac = getfactor(num)
    mul = 1
    for n in fac:
        mul *= n
    if mul == num:
        return fac
    else:
        return fac + suyinzi(num / mul)

